import React from "react";

export default function Card({ image, name, temperaments, weight }) {
  return (
    <div>
      <img src={image} alt="img not found" width="200px" height="250px" />
      <h3>{name}</h3>
      <h5>{temperaments}</h5>
      <h5>{weight}</h5>
    </div>
  );
}
